            const keys = Object.keys(data);
            const filtradas = keys.filter(k => k.toLowerCase().includes(query)).slice(0, 10);

            filtradas.forEach(item => {
                const li = document.createElement("li");
                li.textContent = item;
                li.onclick = () => {
                    document.getElementById("busca").value = item;
                    listaSugestoes.innerHTML = "";
                    pesquisar();
                };
                listaSugestoes.appendChild(li);
            });
        }

        function pesquisar() {
            const query = document.getElementById("busca").value.trim().toLowerCase();
            const resultadoDiv = document.getElementById("resultado");
            resultadoDiv.innerHTML = "";

            const keys = Object.keys(data);
            const encontrados = keys.filter(k => k.toLowerCase().includes(query));

            if (encontrados.length > 0) {
                encontrados.forEach(tag => {
                    const item = data[tag];
                    resultadoDiv.innerHTML += `<div style='margin-bottom:10px;'>
                        <strong>MÁQUINA:</strong> ${item.maquina}<br>
                        <strong>LINHA:</strong> ${item.linha}<br>
                        <strong>CÓDIGO DIMOMAINT:</strong> ${item.dimomaint || '---'}<br>
                        <strong>TAG:</strong> ${tag}<br>
                        <strong>NO.DE PIECE:</strong> ${item.no}<br>
                        <strong>QUANTIDADE:</strong> ${item.quant}<br>
                        <strong>DESCRIÇÃO:</strong> ${item.desc}</div>`;
                });
            } else {
                resultadoDiv.innerHTML = "Nenhum resultado encontrado.";
            }
        }
    </script>
</body>
</html>
